import React, { Component } from 'react';
import './head.css'


class LiName extends Component {
    render() {
        const li_name = [
            "РЕСИВЕРЫ",
            "VOD",
            "iT",
            "SHOW-roomы",
            "заказы",
            "EPG",
            "Каналы",
            "Баги (:"
        ]

        var li_map = li_name.map((value) => {
            return <li className="li"><a>{value}</a><ul></ul></li>
        })
        return li_map
    }
}








class LiName2 extends Component {
    render() {
        return (
            <ul>
                <li className="li"><a>РЕСИВЕРЫ</a>
                    <ul>
                        <Ul ul='1' />
                            <Ul2 ul2='eee'/>
                            <Ul2 ul2='333'/>
                        <Ul ul='2' />
                        <Ul ul='3' />
                    </ul>
                </li>
                <li className="li"><a>VOD</a><ul><Ul ul='4' /><Ul ul='5' /><Ul ul='6' /></ul></li>
                <li className="li"><a>iT</a><ul><Ul ul='17' /><Ul ul='8' /><Ul ul='9' /></ul></li>
                <li className="li"><a>SHOW</a><ul><Ul ul='17' /><Ul ul='8' /><Ul ul='9' /></ul></li>
                <li className="li"><a>заказы</a><ul><Ul ul='17' /><Ul ul='9' /></ul></li>
                <li className="li"><a>EPG</a><ul><Ul ul='17' /><Ul ul='8' /><Ul ul='9' /></ul></li>
                <li className="li"><a>Баги</a><ul><Ul ul='17' /><Ul ul='8' /><Ul ul='9' /></ul></li>
            </ul>
        )
    }
}


class Head_ul extends Component {
    render() {
        return (
            <LiName />
        )
    }
}

export default Head_ul;
